import React, { Component } from "react";
import Header from './Header';
import "./background.css";
export default class Home extends Component{
    render(){
        return(
            <>
            <div>
                {<Header/>}
            </div>
            <div className="bigimg">
                <div className="top"></div>
                <div className="bottom">

                </div>
            </div>
            </>
        )
    }
}
